  `client` varchar(45) COLLATE utf8_general_mysql500_ci NOT NULL,
  `priceDataID` int(11) NOT NULL,
  `quantity` float NOT NULL,
  `fuelPrice` decimal(4,3) NOT NULL,
  `fuelName` varchar(128) COLLATE utf8_general_mysql500_ci NOT NULL,
  `owner` varchar(45) COLLATE utf8_general_mysql500_ci NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `fk_orders_pricedata` (`priceDataID`),
  KEY `fk_orders_owner` (`owner`),
  KEY `fk_orders_client` (`client`),
  CONSTRAINT `fk_orders_client` FOREIGN KEY (`client`) REFERENCES `users` (`username`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `fk_orders_owner` FOREIGN KEY (`owner`) REFERENCES `users` (`username`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `fk_orders_pricedata` FOREIGN KEY (`priceDataID`) REFERENCES `pricedata` (`priceDataID`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_general_mysql500_ci;

