/*Table structure for table `permissions` */

DROP TABLE IF EXISTS `permissions`;

CREATE TABLE `permissions` (
  `permID` int(11) NOT NULL AUTO_INCREMENT,
  `permName` varchar(45) COLLATE utf8_general_mysql500_ci NOT NULL,
  `method` varchar(455) COLLATE utf8_general_mysql500_ci NOT NULL,
  PRIMARY KEY (`permID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_general_mysql500_ci;

/*Data for the table `permissions` */

insert  into `permissions`(`permID`,`permName`,`method`) values (1,'api/v1/pricedata','put'),(2,'api/v1/orders','post'),(3,'api/v1/orders','get');

/*Table structure for table `pricedata` */

DROP TABLE IF EXISTS `pricedata`;

CREATE TABLE `pricedata` (
  `priceDataID` int(11) NOT NULL AUTO_INCREMENT,
  `gasStationID` smallint(5) unsigned NOT NULL,
  `fuelTypeID` tinyint(3) unsigned NOT NULL,
  `fuelSubTypeID` tinyint(3) unsigned NOT NULL,
  `fuelNormalName` varchar(64) COLLATE utf8_general_mysql500_ci NOT NULL,
  `fuelName` varchar(128) COLLATE utf8_general_mysql500_ci NOT NULL,
  `fuelPrice` decimal(4,3) NOT NULL,
  `dateUpdated` timestamp NULL DEFAULT NULL,
  `isPremium` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`priceDataID`),
  UNIQUE KEY `uk_pricedata` (`gasStationID`,`fuelTypeID`,`fuelSubTypeID`),
  KEY `id` (`priceDataID`),
  CONSTRAINT `fk_pricedata_gasstation` FOREIGN KEY (`gasStationID`) REFERENCES `gasstations` (`gasStationID`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=94 DEFAULT CHARSET=utf8 COLLATE=utf8_general_mysql500_ci;

