/*Table structure for table `fuel_analitics` */

DROP TABLE IF EXISTS `fuel_analitics`;

/*!50001 DROP VIEW IF EXISTS `fuel_analitics` */;
/*!50001 DROP TABLE IF EXISTS `fuel_analitics` */;

/*!50001 CREATE TABLE  `fuel_analitics`(
 `fuelTypeId` tinyint(3) unsigned ,
 `avg_price` decimal(8,7) ,
 `max_price` decimal(4,3) ,
 `min_price` decimal(4,3) 
)*/;

/*Table structure for table `user_permissions` */

DROP TABLE IF EXISTS `user_permissions`;

/*!50001 DROP VIEW IF EXISTS `user_permissions` */;
/*!50001 DROP TABLE IF EXISTS `user_permissions` */;

/*!50001 CREATE TABLE  `user_permissions`(
 `username` varchar(45) ,
 `source` varchar(6) ,
 `groupName` varchar(45) ,
 `myPermID` int(11) ,
 `permName` varchar(45) ,
 `method` varchar(455) 
)*/;

/*View structure for view fuel_analitics */

/*!50001 DROP TABLE IF EXISTS `fuel_analitics` */;
/*!50001 DROP VIEW IF EXISTS `fuel_analitics` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`homestead`@`%` SQL SECURITY DEFINER VIEW `fuel_analitics` AS (select `pricedata`.`fuelTypeID` AS `fuelTypeId`,avg(`pricedata`.`fuelPrice`) AS `avg_price`,max(`pricedata`.`fuelPrice`) AS `max_price`,min(`pricedata`.`fuelPrice`) AS `min_price` from `pricedata` group by `pricedata`.`fuelTypeID`) */;

/*View structure for view user_permissions */

/*!50001 DROP TABLE IF EXISTS `user_permissions` */;
/*!50001 DROP VIEW IF EXISTS `user_permissions` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`homestead`@`%` SQL SECURITY DEFINER VIEW `user_permissions` AS select `users`.`username` AS `username`,'group' AS `source`,`groups`.`groupName` AS `groupName`,`permissions`.`permID` AS `myPermID`,`permissions`.`permName` AS `permName`,`permissions`.`method` AS `method` from ((((`users` join `user_has_group`) join `groups`) join `group_has_permission`) join `permissions`) where ((`users`.`username` = `user_has_group`.`username`) and (`user_has_group`.`groupID` = `groups`.`groupID`) and (`user_has_group`.`groupID` = `group_has_permission`.`groupID`) and (`group_has_permission`.`permID` = `permissions`.`permID`)) union select `users`.`username` AS `username`,'direct' AS `source`,NULL AS `NULL`,`permissions`.`permID` AS `myPermID`,`permissions`.`permName` AS `permName`,`permissions`.`method` AS `method` from ((`users` join `user_has_permission`) join `permissions`) where ((`users`.`username` = `user_has_permission`.`username`) and (`user_has_permission`.`permID` = `permissions`.`permID`)) order by `myPermID` */;

